export default function OrderItem({salad}){
  console.log(salad.ingredients)
  return(
    <div>
      <list>
        <li>{salad.ingredients.foundation} </li>
        {salad.ingredients.protein}
        {salad.ingredients.extras}
        {salad.ingredients.dressing}
      </list>
    </div>
  )
}
